import styled from "styled-components";

export const Container = styled.div`
  height: 100vh;
  width: 100vw;
  position: absolute;
  top: 0;
  left: 0;

  .box {
    height: 300px;
    width: 300px;
    margin: 20% auto;
    background-color: #red;
  }
`;
